import React, { useState } from 'react';

const HomePage = () => {
  return (
    <div className="min-h-screen bg-gray-50">
      <div className="max-w-7xl mx-auto py-12 px-4">
        <h1 className="text-4xl font-bold text-gray-900 mb-8">Welcome to Thrive International</h1>
        <p className="text-xl text-gray-600">Supporting refugees in their journey to thrive.</p>
      </div>
    </div>
  );
};

const AboutUs = () => {
  return (
    <div className="min-h-screen bg-gray-50">
      <div className="max-w-7xl mx-auto py-12 px-4">
        <h1 className="text-3xl font-bold text-gray-900 mb-6">About Us</h1>
        <p className="text-lg text-gray-600">
          Thrive International is dedicated to helping refugees establish new lives
          through comprehensive support services and community integration programs.
        </p>
      </div>
    </div>
  );
};

const IntakeForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    gender: ''
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    // Handle form submission here
  };

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="max-w-3xl mx-auto py-12 px-4">
        <h2 className="text-3xl font-bold text-gray-900 mb-8">Refugee Intake Form</h2>
        <form onSubmit={handleSubmit} className="space-y-6">
          <div>
            <label htmlFor="name" className="block text-sm font-medium text-gray-700">
              Full Name
            </label>
            <input
              type="text"
              id="name"
              value={formData.name}
              onChange={(e) => setFormData({...formData, name: e.target.value})}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-500 focus:ring-blue-500"
              required
            />
          </div>

          <div>
            <label htmlFor="gender" className="block text-sm font-medium text-gray-700">
              Gender
            </label>
            <select
              id="gender"
              value={formData.gender}
              onChange={(e) => setFormData({...formData, gender: e.target.value})}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-500 focus:ring-blue-500"
              required
            >
              <option value="">Select gender</option>
              <option value="male">Male</option>
              <option value="female">Female</option>
              <option value="other">Other</option>
            </select>
          </div>

          <button
            type="submit"
            className="w-full flex justify-center py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
          >
            Submit
          </button>
        </form>
      </div>
    </div>
  );
};

const Navigation = ({ setCurrentPage }) => {
  return (
    <nav className="bg-white shadow">
      <div className="max-w-7xl mx-auto px-4">
        <div className="flex justify-between h-16">
          <div className="flex space-x-8">
            <button 
              onClick={() => setCurrentPage('home')}
              className="flex items-center px-2 py-2 text-gray-700 hover:text-gray-900"
            >
              Home
            </button>
            <button 
              onClick={() => setCurrentPage('intake')}
              className="flex items-center px-2 py-2 text-gray-700 hover:text-gray-900"
            >
              Intake Forms
            </button>
            <button 
              onClick={() => setCurrentPage('about')}
              className="flex items-center px-2 py-2 text-gray-700 hover:text-gray-900"
            >
              About Us
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
};

const App = () => {
  const [currentPage, setCurrentPage] = useState('home');

  const renderPage = () => {
    switch (currentPage) {
      case 'home':
        return <HomePage />;
      case 'intake':
        return <IntakeForm />;
      case 'about':
        return <AboutUs />;
      default:
        return <HomePage />;
    }
  };

  return (
    <div>
      <Navigation setCurrentPage={setCurrentPage} />
      {renderPage()}
    </div>
  );
};

export default App;
